import "antd/dist/antd.css";
import "./index.css";
import MovieList from "./components /MovieList";
import Filter from "./components /Filter";
function App() {
  return (
    <>
      <h2>
        <strong>Movies</strong>
      </h2>
      <Filter />
      <MovieList />
    </>
  );
}
export default App;
